create table "TestData"
(
    id         int          not null constraint testdata_pk primary key,
    first_name varchar(50)  not null,
    last_name  varchar(50)  not null,
    email      varchar(50),
    gender     varchar(50)  not null,
    "image"    bytea not null,
    salary     decimal(7, 2)
);

create index "IX_LastName_Gender"
    on "TestData" (last_name, gender);


create table "Foo"
(
    id   int         not null
        constraint foo_pk
            primary key,
    name varchar(50) not null
);

create schema "TEST";

create table "TEST"."TestValues"
(
    id   int         not null
        constraint foo_pk
            primary key,
    name varchar(50) not null
);


